:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  WILLIAMS, William Leonard and WANKLYN. Sarah
  JWILLIAMS, Francis James Volkner (Frank) and STANDISH, Edith Frances
  JWILLIAMS, Leonard Heathcote (Bill) and WILLIAMS, Janet Mary
  04> WILLIAMS, Leonard Heathcote (Bill) m on 06.02.1948 to WILLIAMS, Janet Mary
  b 27.05.1912 d 28.11.1979
  b 16.07.1918 d 28.11.1979
  Leonard b. at Napier and m. at Gisborne. Janet, d/o Heathcote Beetham Williams and Mary
  Anderson Myhill, b. at Gisborne, Bill and Jan both d, in the Erebus crash in Antarctica.
  Bill went to school at Huntley and Christ's College, attended Woolwich Military College
  (1931-32) and Cambridge University (BA, Engineering, Mech Science Tripos 1934). Before WW2
  Bill served in Mandalay (Burma) and north India. While he was surveying in the foothills of
  the Himalayas his tent was struck by lightning and Bill was severely burned. During the war
  he was stationed in Persia and later in England and Singapore, attaining the rank of Lieutenant Colonel.
  Jan also graduated BA(Literature) from Cambridge and later taught at Woodford House, Havelock North, Bill
  and Jan purchased "Longacre" farm near Havelock North in 1956. They designed the homestead, extensive
  garden, plantations and lake and farmed there until their deaths. They set up the Springhill Charitable
  Trust in 1967 and the Frimley Charitable Trust in 1975.
  01> WILLIAMS, Andrew Leonard Heathcote
  b 17.01.1949 d 29.12.1985
  Andrew b. and d, at Hastings.
  01> WILLIAMS, Samuel Leonard
  b 28.04.1979
  Samuel b. at Hastings.
  02> WILLIAMS, James Leonard m on 02.07.1977 to VIGORS, Sarah Ann (Sally)
  Heathcote
  b 13.04.1950
  b 26.11.1946
  James b. at Gisborne and m, at Straffan, Co Kildare, Eire. Sally, d/o Tim Vigors and Jan
  Murray. Address: Longacre, RD 12, Havelock North.
  James was educated at Hereworth School, Christ's College and Otago University (BA,
  1972). In 1969 he was a VSA volunteer to the Solomon Islands, In 1981 James and Sally
  moved to "Longacre" where they are now farming.
  01> WILLIAMS, Tarka James Arnold
  b 12.04.1978
  Tarka b. at Rotorua. After leaving Havelock North High School in 1996, Tarka
  "a com
  completed a course with Youth With a Mission in 1997.
  02> WILLIAMS, Oscar Timothy Leonard
  b 31.07.1979
  Oscar b. at Hastings. He left Wanganui Collegiate School in 1997 and is presently
  tutoring at the Royal Guildford Grammar School in England.
